import React from "react";
import { Container } from './style';

const Home: React.FC = () => {
  return (
      <Container>
         <section>
             <div>
                 <img src="" alt="" />
                 <span></span>
                 <h6>price</h6>
             </div>
         </section>
      </Container>
  );
}

export default Home;
